import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import myImg from "../../Assets/avatar.svg";
import Tilt from "react-parallax-tilt";
import {
  AiFillGithub,
  AiOutlineTwitter,
  AiFillInstagram,
} from "react-icons/ai";
import { FaLinkedinIn } from "react-icons/fa";
import cat1 from "../../Assets/cat1real.png";
import cat2 from "../../Assets/cat2real.png";
import cat3 from "../../Assets/cat3real.png";
import cat4 from "../../Assets/cat4real.png";
import nobgcat from "../../Assets/catnobg.png"
import { useState } from "react";
import ReactDOM from "react-dom";
import CollapsiblePanel from "./CollapsiblePanel";

function App() {
    const text1 =
        "Shorten";
    const text2 = "Hello my name is Jun";
    const text3 = "I am making this website";
    const text4 = "Currently I am doing that";
    const [collapse, setCollapse] = useState(true);
    const [title, setTitle] = useState("Expand All");
    const [icon, setIcon] = useState("fa fa-chevron-right");
    const collapseAll = () => {
        setCollapse(!collapse);
        setIcon(state => {
            return state === "fa fa-chevron-right"
                ? "fa fa-chevron-down"
                : "fa fa-chevron-right";
        });
        setTitle(state => {
            return state === "Expand All" ? "Collapse All" : "Expand All";
        });
    };
    return (
        <div>
            {/* Expand/Collapse All */}
            {/* <button
                type="button"
                className="btn-warning mt-4 mb-3 float-left"
                onClick={collapseAll}
            >
                <i className={icon} /> {title}
            </button> */}
            <Row noGutters>
            <Col md={4} style={{ paddingTop: 50, paddingRight: 0 }}>
            <img
            //   className="hate"
              src={cat1}
              alt="home pic"
            //   className="img-fluid"
              style={{ maxHeight: "150px" }}
            />
          </Col>
          <Col md={4} style={{ display: 'flex', justifyContent: 'flex-start', marginLeft: '-50px', alignItems: 'center', paddingTop: 50 }}>
          <CollapsiblePanel title="Create a Wallet" collapse={collapse}>
                <span style={{ fontSize: 25, display: 'flex', justifyContent: 'flex-start', alignItems: 'center', paddingTop: 50, marginLeft: '15px' }}>{text1}</span>
            </CollapsiblePanel>
          </Col>
          </Row>
          <br></br>
          <hr></hr>

          <Row noGutters>
            <Col md={4} style={{ paddingTop: 50, paddingRight: 0 }}>
            <img
            //   className="hate"
              src={cat2}
              alt="home pic"
            //   className="img-fluid"
              style={{ maxHeight: "150px" }}
            />
          </Col>
          <Col md={4} style={{ display: 'flex', justifyContent: 'flex-start', marginLeft: '-50px', alignItems: 'center', paddingTop: 50 }}>
          <CollapsiblePanel  title="Get some Sol" collapse={collapse}>
                <span style={{ fontSize: 25, display: 'flex', justifyContent: 'flex-start', alignItems: 'center', paddingTop: 50, marginLeft: '15px' }}>{text2}</span>
            </CollapsiblePanel>
          </Col>
          </Row>
          <br></br>
          <hr class="line"></hr>

          <Row noGutters>
            <Col md={4} style={{ paddingTop: 50, paddingRight: 0 }}>
            <img
            //   className="hate"
              src={cat3}
              alt="home pic"
            //   className="img-fluid"
              style={{ maxHeight: "150px" }}
            />
          </Col>
          <Col md={4} style={{ display: 'flex', justifyContent: 'flex-start', marginLeft: '-50px', alignItems: 'center', paddingTop: 50 }}>
          <CollapsiblePanel title="Connect to Dexscreener/Jupiter" collapse={collapse}>
                <span style={{ fontSize: 25, display: 'flex', justifyContent: 'flex-start', alignItems: 'center', paddingTop: 50, marginLeft: '15px' }}>{text3}</span>
            </CollapsiblePanel>
          </Col>
          </Row>
          <br></br>
          <hr></hr>

          <Row noGutters>
            <Col md={4} style={{ paddingTop: 50, paddingRight: 0 }}>
            <img
            //   className="hate"
              src={cat4}
              alt="home pic"
            //   className="img-fluid"
              style={{ maxHeight: "150px" }}
            />
          </Col>
          <Col md={4} style={{ display: 'flex', justifyContent: 'flex-start', marginLeft: '-50px', alignItems: 'center', paddingTop: 50 }}>
          <CollapsiblePanel className="hate" title="Trade all fo Standing Cat" collapse={collapse}>
                <span style={{ fontSize: 25, display: 'flex', justifyContent: 'flex-start', alignItems: 'center', paddingTop: 50, marginLeft: '15px' }}>{text4}</span>
            </CollapsiblePanel>
          </Col>
          </Row>
          <br></br>
          <hr></hr>
        </div>
    );
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);

function Home4() {
  return (
    <Container fluid className="home-buy-section" id="about">
      <Container>
        <Row>
          {/* <Col md={4} style={{ paddingTop: 50 }}>
            <img
              src={catBull}
              alt="home pic"
              className="img-fluid"
              style={{ maxHeight: "450px" }}
            />
          </Col> */}
          <center>
          <Col md={12}> 
            <h1 className="main-name" style ={{ paddingTop: 25, fontSize: 85, color: '#000000' }}>
                How to Buy
            </h1>
          </Col>
          </center>
          {/* <Col md={4} style={{ paddingTop: 50 }}>
            {/* <img
              src={cat1}
              alt="home pic"
              className="img-fluid"
              style={{ maxHeight: "85px" }}
            /> */}
          {/* </Col> */}
          <h1 className="heading-name" style ={{ paddingTop: 50 }}>
                ples buy :(
              </h1>
              <img
            //   className="hate"
              src={nobgcat}
              alt="home pic"
              style= {{ }}
            //   className="img-fluid"
              // style={{ maxHeight: "25px" }}
            />
              <App />
          {/* <Col md={8} className="home-about-description">
            <h1 style={{ fontSize: "2.6em" }}>
              About <span className="main-name"> Standing Cat </span> 
            </h1>
            <p className="home-about-body">
              Quick BS description of meme coin. Talk about how no tax, no presale, and how this coin will be bullish
            </p>
          </Col> */}
        </Row>
        <Row>
          <Col>
          </Col>
        </Row>
      </Container>
    </Container>
  );
}
export default Home4;
